import React, { useContext } from "react";
import { DogContext } from "../Context/ContextProvider";
import DogsCart from "./DogsCart";

const DogsPage = () => {
  const { dogs } = useContext(DogContext);

  return (
    <div>
      <section className="dogs mt-3">
        <div className="row">
          {dogs &&
            dogs.map((dog) => {
              return <DogsCart key={dog.id} dog={dog} />;
            })}
        </div>
      </section>
    </div>
  );
};

export default DogsPage;
